import React from "react";

const Main = ({ children }) => {
    const mainStyle = {
        maxHeight: '100%',
        maxWidth: '100%',
        marginTop: '20px',
    };

    return (
        <main id="main" role="main" style={mainStyle}>
            {children}
        </main>
    );
};

export default Main;
